import React from "react";
import PropTypes from "prop-types";
import { withTranslation } from 'config/i18n'

const Header = ({t}) => {
	return (
		<>
			<div>Header created. Translation {t("init")}</div>
		</>
	);
};

Header.propTypes = {};

export default withTranslation("header")(Header);
